import { Provider } from 'react-redux';
import './styles/App.scss';
import { store } from './redux/store';
import {BrowserRouter as Router, Redirect, Switch} from "react-router-dom"
import React, { Suspense } from 'react';
import AppRoute from './routing/AppRoute';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Footer from './layout/footer/Footer';
import 'react-toastify/dist/ReactToastify.css';
import Loader from './reuseable/Loader/Loader';
import exchangesRoutes from './pages/exchanges/exchangesRoutes';

function App() {

  const homeRoutes = React.lazy(()=>import("./pages/home/homeRoutes"))
  const converterRoutes = React.lazy(()=>import("./pages/converter/converterRoutes"))
  const historialRoutes = React.lazy(()=>import("./pages/historical/historicalRoutes"))
  const exchangesRoutes = React.lazy(()=>import("./pages/exchanges/exchangesRoutes"))
  const aboutRoutes = React.lazy(()=>import("./pages/about/aboutRoutes"))

  return (
    <Provider store={store}>
      <Router>
        <Suspense fallback={<Loader/>}>
            <Switch>
              <Redirect exact from="/" to="/home"/>
              <AppRoute protect={false} path="/home" component={homeRoutes}></AppRoute>
              <AppRoute protect={false} path="/exchanges" component={exchangesRoutes}></AppRoute>
            </Switch>
        </Suspense>
        <Footer/>
      </Router>
    </Provider>
  );
}

export default App;
